import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar'; // Correct import
import Home from './components/Home'; // Correct path for Home component
import About from './components/About'; // Correct path for About component
import Services from './components/Services';
import Destination from './components/Destination';
import Tour from './components/Tour';
import Package from './components/Package';
import Booking from './components/Booking';
import Guide from './components/Guide';
import Blogs from './components/Blogs';
import Testimonial from './components/Testimonial';
import NewsLetter from './components/NewsLetter';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/services" element={<Services />} />
        <Route path="/destination" element={<Destination />} />
        <Route path="/tour" element={<Tour />} />
        <Route path="/package" element={<Package />} />
        <Route path="/booking" element={<Booking />} />
        <Route path="/guide" element={<Guide />} />
        <Route path="/blogs" element={<Blogs />} />
        <Route path="/testimonial" element={<Testimonial />} />
        <Route path="/newsletter" element={<NewsLetter />} />
      </Routes>
      <Footer /> {/* Place footer outside of Routes if you want it on all pages */}
    </Router>
  );
}

export default App;
